import React from 'react';

const Books = props => (
    <div>
         { props.books.map((book) => {
            return (
              <div key={book.primary_isbn13} className='tc baskerville fl w-20 tc dib br--bottom pa3 ma3 grow bw2 shadow-5'>
                <img src={book.book_image} alt={book.title} height="193" width="128"/>
                <p className="b">{ book.title }</p>
                <p>by { book.author }</p>
                <p className="">{ book.description }</p>
              </div>
              );
          })
          }
    </div>
);

export default Books;
